import React from "react";

function Food({ name }) {
  console.log(props);
  return <h3>I love {name}</h3>;
}

const foodLike = [
  {
    name: "kimchi",
  },

  {
    name: "samgyeopsal",
  },
];

function App() {
  return (
    <div>
      {foodLike.map((dish) => (
        <Food name={dish.name} />
      ))}
    </div>
  );
}

export default App;
